"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[306],{9922:t=>{t.exports=JSON.parse('{"label":"Python","permalink":"/portfolio/docs/tags/python","allTagsPath":"/portfolio/docs/tags","count":8,"items":[{"id":"eda/missing-data","title":"Dealing with Missing Data","description":"Welcome, fellow data enthusiasts and Python aficionados! Today, we embark on a thrilling journey to tackle one of the most common challenges in data science &mdash; missing data! Ah, those pesky gaps in our datasets that can ruin our models and give us headaches. But fear not! With Python as our trusty companion, we shall equip ourselves with the skills to handle missing data. So, fasten your seatbelts and let\u2019s dive in!","permalink":"/portfolio/docs/eda/missing-data"},{"id":"misc/pep8","title":"PEP 8","description":"Introduction","permalink":"/portfolio/docs/misc/pep8"},{"id":"data-visualization/pitfalls","title":"Pitfalls in Data Visualization","description":"Hello data enthusiasts!","permalink":"/portfolio/docs/data-visualization/pitfalls"},{"id":"eda/polars","title":"Polars","description":"Introduction","permalink":"/portfolio/docs/eda/polars"},{"id":"misc/qrcode","title":"QR Code","description":"Welcome to the world of QR code generation! As a data scientist, I understand the importance of effective data representation, and QR codes are a fantastic tool for this purpose. In this tutorial, we\u2019ll embark on a journey to demystify QR code generation using python-qrcode, ensuring that you gain practical skills to implement QR code generation effortlessly. So, grab your coding gear and let\u2019s get started!","permalink":"/portfolio/docs/misc/qrcode"},{"id":"misc/rich","title":"Rich Terminal","description":"Welcome to a fascinating journey into the enchanting realm of the rich Python library! If you\u2019re tired of plain, monotonous outputs and yearn to bring a touch of elegance and flair to your code results, then you\u2019re in for a treat. In this article, we\u2019ll explore how the rich library can turn your command-line outputs into eye-catching masterpieces. So, grab your code editor and let\u2019s dive into the world of syntax highlighting, tables, progress bars, emojis, and more like you\u2019ve never seen before!","permalink":"/portfolio/docs/misc/rich"},{"id":"scrape/jobinventory.com","title":"Scraping Job Listings","description":"Are you tired of manually scrolling through endless job postings to find the perfect opportunity? Look no further! In this tutorial, I\u2019ll walk you through the steps of scraping job listings from JobInventory.com using Python.","permalink":"/portfolio/docs/scrape/jobinventory.com"},{"id":"data-visualization/lets-plot","title":"Visualization with lets-plot","description":"Hi, fellow data enthusiasts! Today, we\u2019re setting sail on a delightful journey to explore the world of data visualization with lets-plot Python package, a captivating gem, by JetBrains, inspired by the legendary ggplot2 from the R universe. If you\u2019re tired of bland and dull plots that make you yawn louder than a bear in hibernation, fear not! lets-plot is here to save the day with its elegance, versatility, and charm. So, hoist your Python flags high and let\u2019s embark on this hands-on adventure!","permalink":"/portfolio/docs/data-visualization/lets-plot"}]}')}}]);